void VNV_NVDLA_CMAC_core::trace(VerilatedVcdC* tfp, int, int) {
    tfp->spTrace()->addCallback(&VNV_NVDLA_CMAC_core::traceInit, &VNV_NVDLA_CMAC_core::traceFull, &VNV_NVDLA_CMAC_core::traceChg, this);
}
void VNV_NVDLA_CMAC_core::traceInit(VerilatedVcd* vcdp, void* userthis, uint32_t code) {
    // Callback from vcd->open()
    VNV_NVDLA_CMAC_core* t=(VNV_NVDLA_CMAC_core*)userthis;
    VNV_NVDLA_CMAC_core__Syms* __restrict vlSymsp = t->__VlSymsp;  // Setup global symbol table
    if (!Verilated::calcUnusedSigs()) {
	VL_FATAL_MT(__FILE__,__LINE__,__FILE__,"Turning on wave traces requires Verilated::traceEverOn(true) call before time 0.");
    }
    vcdp->scopeEscape(' ');
    t->traceInitThis(vlSymsp, vcdp, code);
    vcdp->scopeEscape('.');
}
void VNV_NVDLA_CMAC_core::traceFull(VerilatedVcd* vcdp, void* userthis, uint32_t code) {
    // Callback from vcd->dump()
    VNV_NVDLA_CMAC_core* t=(VNV_NVDLA_CMAC_core*)userthis;
    VNV_NVDLA_CMAC_core__Syms* __restrict vlSymsp = t->__VlSymsp;  // Setup global symbol table
    t->traceFullThis(vlSymsp, vcdp, code);
}

